import FacilityCard from '../FacilityCard/FacilityCard';

const HomeFacilitySection = ({ facilities }) => {
  return (
    <section className="mb-16">
      <h2 className="text-2xl font-bold mb-6">
        Cơ sở y tế nổi bật
      </h2>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {facilities.map(item => (
          <FacilityCard key={item.id} facility={item} />
        ))}
      </div>
    </section>
  );
};

export default HomeFacilitySection;
